      \[ 344 \div 8 = 43 \]


      Since 344 is divisible by 8, the entire expression \( 7^{2020} \times 344 \)
      is also divisible by 8.


      ### Step 5: Final Answer


      Therefore, the expression \( 7^{2023} + 7^{2020} \) is divisible by 8.


